import React from "react";
import "./ExperienceCard.scss";

export default function ExperienceCard({ period, title, type, caption, position, image }) {
  return (
    <div className="card mb-3 text-center experience-card mx-auto" style={{backgroundColor: "blue"}}>
      <div className="row no-gutters">
        <div className="col-md-4 m-auto">
          <img src={image} className="card-img" alt="logo" height={"25%"} />
        </div>
        <div className="col-md-8 m-auto">
          <div className="card-body">
            <h5 className="card-title">{title} | {position}</h5>
            <h5 className="card-title">{period}</h5>
            <p className="card-text">
              {caption}
            </p>
            <h5>{type}</h5>
          </div>
        </div>
      </div>
    </div>
  );
}
